import  React  from 'react';
import './App.css'
export default function Partners(){
    const partnerdata=[
        {
            img:'PartnerImage/cigref.png',
            title:""
        },
        {
            img:'PartnerImage/infogreffe.png',
            title:""
        },
        {
            img:'Partner/infotch.png',
            title:""
        },
        {
            img:'PartnerImage/nextInformation.png',
            title:""
        },
        {
            img:'PartnerImage/nintex.png',
            title:""
        },
        {
            img:'PartnerImage/.png',
            title:""
        }
    ]
    const dispPartner=partnerdata.map(item=>{
        <div className='partnerImage'><img style={{width:'60%', height:'40%'}}src={item.img} /></div>
    })
    return(
        <section>
            <h1>Nos Partenaires</h1>
            {dispPartner}
        </section>
    )
}
